// SPDX-License-Identifier: GPL-3.0
pragma solidity ^0.8.19;

import "./PadelToken.sol";

contract Torneo {

    PadelToken private padelToken;

    address private tokenContract;

    uint256 public constant MAX_EQUIPOS = 32;

    uint constant BYE_ID = 34;

    address creador;

    struct Partida {
        string ronda;
        uint equipo1Id;
        uint equipo2Id;
        string resultado;
        string horario;
        uint ganador; // 0=ninguno, 1=equipo1, 2=equipo2
    }

    struct NodoCuadro {
        uint proximaPartidaId;
        Partida partida;
        bool cuadroArriba;
    }

    struct Equipo {
        uint equipoId;
        address jugador1;
        address jugador2;
    }

    uint public numeroEquipos;
    uint public totalPartidas;
    bool faseInscripcion;

    NodoCuadro[] public partidas;

    Equipo[] public equipos;

    string public nombreTorneo;

    string public fechaInicio;

    string public fechaFin;

    constructor(address _tokenContract, string memory _nombreTorneo, string memory _fechaInicio, string memory _fechaFin) {
        totalPartidas = 0;
        faseInscripcion = true;
        creador = msg.sender;
        tokenContract = _tokenContract;
        padelToken = PadelToken(_tokenContract);
        nombreTorneo = _nombreTorneo;
        fechaInicio = _fechaInicio;
        fechaFin = _fechaFin;
    }

    function getFechaInicio() public view returns (string memory) {
        return fechaInicio;
    }

    function getFechaFin() public view returns (string memory) {
        return fechaFin;
    }

    function getNombreTorneo() public view returns (string memory) {
        return nombreTorneo;
    }

    modifier onlyOwner() {
        require(msg.sender == creador, "No tienes permisos de administrador");
        _;
    }

    function equiposByPartida(uint numPartida) public view returns(uint, uint, string memory, string memory, string memory) {
        require(!faseInscripcion, "Aun no se han generado las partidas");
        Partida memory partida = partidas[numPartida].partida;
        return (partida.equipo1Id, partida.equipo2Id, partida.horario, partida.resultado, partida.ronda);
    }

    function generarEmparejamientos() private {
        uint numPartidosPrimeraRonda = numeroDePartidasByRonda(calcularRondas(numeroEquipos) - 1);
        for(uint i = 0; i < numPartidosPrimeraRonda; i++){
            Equipo memory equipo = equipos[i];
            partidas[i].partida.equipo1Id = equipo.equipoId;
        }
        numPartidosPrimeraRonda = numeroDePartidasByRonda(calcularRondas(numeroEquipos) - 1);
        addEquipos2(numPartidosPrimeraRonda);
    }

    // SE PUEDE QUITAR UN BUCLE
    function addEquipos2(uint numPartidosPrimeraRonda) private {
        uint equipoRestante = numPartidosPrimeraRonda;
        for(uint i = equipoRestante; i < numeroEquipos; i++){
            Equipo memory equipo = equipos[i];
            for(uint j = 0; j < numPartidosPrimeraRonda; j++){
                if (partidas[j].partida.equipo2Id == BYE_ID) {
                    partidas[j].partida.equipo2Id = equipo.equipoId;
                    break;
                }
            }
        }
    }

    function getEquipos() public view returns (Equipo[] memory) {
        return equipos;
    }

    function sorteoEquipos() private {
        Equipo[] memory tempArr = equipos;
        uint n = equipos.length;

        while (n > 0) {
            n--;
            uint randIndex = _random(n + 1);
            Equipo memory temp = tempArr[randIndex];
            tempArr[randIndex] = tempArr[n];
            tempArr[n] = temp;
        }

        for (uint i = 0; i < equipos.length; i++) {
            equipos[i] = tempArr[i];
        }
    }

    function _random(uint _max) private view returns (uint) {
        return uint(keccak256(abi.encodePacked(block.timestamp, block.difficulty, msg.sender))) % _max;
    }


    function addEquipo(address jugador1, address jugador2) public {
        //TODO: ACTIVAR Y PROBAR ESTO: require(msg.sender == tokenContract, "Debes realizar el pago antes de inscribirte");
        require(numeroEquipos < MAX_EQUIPOS, "El torneo esta completo");
        require(faseInscripcion, "La fase de inscripcion ha sido cerrada");
        require(jugador1 != jugador2, "No se puede inscribir al mismo jugador en un mismo equipo");
        require(!isInscrito(jugador1, jugador2), "Alguno de los jugadores ya esta inscrito en otro equipo");

        equipos.push(Equipo(numeroEquipos, jugador1, jugador2));
        numeroEquipos++;
        if (numeroEquipos == MAX_EQUIPOS) {
            cerrarInscripciones();
        }
    }

    function cerrarInscripciones() public onlyOwner { 
        // poner un require de que solo se puede ejecutar cuando
        // faseInscripcion = true y cuando hay mas de 1 equipo apuntado       
        faseInscripcion = false;
        inicializarPartidas();
        sorteoEquipos();
        generarEmparejamientos();
        mezclarPartidas();
        pasarDeRondaEquiposConBye();
        totalPartidas = calcularTotalPartidas();
    }

    function pasarDeRondaEquiposConBye() private {
        uint numPartidosPrimeraRonda = numeroDePartidasByRonda(calcularRondas(numeroEquipos) - 1);

        for(uint i = 0; i < numPartidosPrimeraRonda; i++) {
            NodoCuadro memory nodoCuadro = partidas[i];
            if (nodoCuadro.partida.equipo2Id == BYE_ID) {
                partidas[i].partida.ganador = 1;
                pasarDeRonda(1, i);
            }
        }

    }

    function pasarDeRonda(uint numEquipoEnPartida, uint numPartida) private {
        NodoCuadro memory nodoCuadro = partidas[numPartida];
        uint equipoId;
        if (numEquipoEnPartida == 1) {
            equipoId = nodoCuadro.partida.equipo1Id;
        } else {
            equipoId = nodoCuadro.partida.equipo2Id;
        }

        if (nodoCuadro.cuadroArriba) {
            partidas[nodoCuadro.proximaPartidaId].partida.equipo1Id = equipoId;
        } else {
            partidas[nodoCuadro.proximaPartidaId].partida.equipo2Id = equipoId;
        }
    }

    function mezclarPartidas() private {
        uint n = numeroDePartidasByRonda(calcularRondas(numeroEquipos) - 1);

        for (uint i = n - 1; i > 0; i--) {
            uint j = uint(keccak256(abi.encodePacked(block.timestamp, msg.sender, i))) % (i + 1);
            NodoCuadro memory temp = partidas[i];
            partidas[i].partida = partidas[j].partida;
            partidas[j].partida = temp.partida;
        }
    }

    function inicializarPartidas() private {
        uint numRondas = calcularRondas(numeroEquipos);
        uint nextPartidoSiguienteRonda = 0;
        for(uint i = numRondas; i > 0; i--){
            uint partidaRellenada = 0;
            nextPartidoSiguienteRonda += numeroDePartidasByRonda(i - 1);
            uint siguienteRonda = nextPartidoSiguienteRonda;
            bool cuadroArriba = true;
            for(uint j = 0; j < numeroDePartidasByRonda(i - 1); j++) {   
                if (partidaRellenada == 2) {
                    siguienteRonda++;
                    partidaRellenada = 0;
                }

                Partida memory partida = Partida(ronda(i - 1), BYE_ID, BYE_ID, "", "", 0);
                NodoCuadro memory nodoCuadro = NodoCuadro(siguienteRonda, partida, cuadroArriba);
                partidas.push(nodoCuadro);
                cuadroArriba = !cuadroArriba;
                partidaRellenada++;
            }
        }
    }

    function isInscrito(address jugador1, address jugador2) private view returns (bool) {
        for(uint i = 0; i < numeroEquipos; i++){
            Equipo memory equipo = equipos[i];
            if (equipo.jugador1 == jugador1 || equipo.jugador1 == jugador2
                || equipo.jugador2 == jugador1 || equipo.jugador2 == jugador2){
                return true;
            }
        }
        return false;
    }
    
    function numeroDePartidasByRonda (uint numRronda) private pure returns (uint) {
        if (numRronda == 4) { // dieciseisavos
            return 16;
        } else if (numRronda == 3) { // octavos
            return 8;
        } else if (numRronda == 2) { // cuartos
            return 4;
        } else if (numRronda == 1) { // semis
            return 2;
        } else if (numRronda == 0) { // final
            return 1;
        }
        return 0;
    }

    function ronda (uint numRonda) private pure returns (string memory) {
        // TODO: poner la traduccion igual al front
        if (numRonda == 4) { // dieciseisavos
            return "Dieciseisavo";
        } else if (numRonda == 3) { // octavos
            return "Octavo";
        } else if (numRonda == 2) { // cuartos
            return "Cuarto";
        } else if (numRonda == 1) { // semis
            return "Semifinal";
        } else if (numRonda == 0) { // final
            return "Final";
        }
        return "";
    }

    function isFinal(uint partida) private view returns (bool) {
        bytes32 _ronda = keccak256(abi.encodePacked(partidas[partida].partida.ronda));
        bytes32 _final = keccak256(abi.encodePacked("Final"));
        return _ronda == _final;
    }

    function calcularRondas(uint _equipos) private pure returns (uint) {
        uint rondas = 0;
        uint potenciaDeDos = 1;

        while (potenciaDeDos < _equipos) {
            potenciaDeDos *= 2;
            rondas++;
        }
        return rondas;
    }

    function getPartidas() public view returns (NodoCuadro[] memory) {
        return partidas;
    }

    function calcularTotalPartidas() private view returns (uint) {
        uint res = 0;

        for(uint i = 0; i < calcularRondas(numeroEquipos); i++) {
            res += numeroDePartidasByRonda(i);
        }
        
        return res;
    }

    function setResultado(uint numPartida, uint numEquipoPartidaGanador, string memory _resultado) public onlyOwner {
        require(!faseInscripcion, "Aun no se han generado las partidas");

        partidas[numPartida].partida.resultado = _resultado;
        partidas[numPartida].partida.ganador = numEquipoPartidaGanador;


        if(isFinal(numPartida)){
            uint equipoId;
            if(numEquipoPartidaGanador == 1){
                equipoId = partidas[numPartida].partida.equipo1Id;
            } else {
                equipoId = partidas[numPartida].partida.equipo2Id;
            }
            Equipo memory equipoGanador = getEquipo(equipoId);
            distribuirTokens(equipoGanador.jugador1, equipoGanador.jugador2);
        } else {
            pasarDeRonda(numEquipoPartidaGanador, numPartida);
        }
    }

    function getEquipo(uint _equipoId) private view returns (Equipo memory) {
        for(uint i = 0; i < equipos.length; i++){
            if (equipos[i].equipoId == _equipoId) {
                return equipos[i];
            }
        }
        return Equipo(0,address(0) , address(0));
    }

    function setHorario(uint numPartida, string memory _horario) public onlyOwner {
        require(!faseInscripcion, "Aun no se han generado las partidas");

        partidas[numPartida].partida.horario = _horario;
    }

    function distribuirTokens(address jugador1, address jugador2) private {
        padelToken.recompensaTorneo(creador, jugador1, jugador2, 10, 40);
    }

}
